import React, { Component } from 'react';
import './App.css';

class App extends Component {

  // componentDidMount() {
  //   fetch('http://127.0.0.1:1812/')
  //       .then(Response => Response.json())
  //       .then(console.log)
  // }

  render() {
    return (
      <div className="App">
        <div>
          <input  type="text" placeholder="ENTER YOU AGE"></input>      <br />

          <label htmlFor="male" >Male</label><br />
          <input  type="radio" name="gender" value="male"></input><br />

          <label htmlFor="female">Female</label><br />
          <input  type="radio" name="gender" value="female"></input><br />

          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input>
        </div>
      </div>
    );
  }
}

export default App;
